<p>Хрустящие подушечки для кошек с паштетом из говядины &ndash; это вкусное и полезное лакомство. Паштет содержащийся внутри каждой подушечки имеет мягкую однородную консистенцию в виде мусса и неповторимый нежный вкус. Благодаря бережной технологии изготовления паштета, удалось сохранить полезные свойства мяса говядины, поэтому лакомство богато ценным белком, важнейшими минералами и витаминами.</p>
<h5>Условия хранения:</h5>
<p>Хранить при температуре от +4&deg;С до +25&deg;С и относительной влажности не более 75%.</p>
